    def banLineEdit(self,i):
        eval("self.variableInput"+str(i)+".setEnabled(False)")
    
    def allowLineEdit(self,i):
        eval("self.variableInput"+str(i)+".setEnabled(True)")
    
    def setVariableGroupStatus(self,i):
        if self.variableGroups[i].isChecked():      # 如果点击后当前GroupBox的状态是√
            for j in range(1,i):                    # 把前面的GroupBox的变成√
                self.variableGroups[j].setChecked(True)
        else:                                       # 如果点击后当前GroupBox的状态是未选中
            for j in range(i,6):                    # 把后续的GroupBox都变成未选中
                self.variableGroups[j+1].setChecked(False)
        if not self.variableGroups[1].isChecked():
            self.warning.show()
        else:
            self.warning.hide()
    
    def resetAllGroups(self):
        for i in range(6):
            self.variableGroups[i+1].setChecked(False)
            self.genRButtons[i+1][0].setChecked(True)
            self.mutRButtons[i+1][0].setChecked(True)
            eval("self.variableInput"+str(i+1)+".setEnabled(True)")
            eval("self.variableInput"+str(i+1)+".clear()")
            self.Delimiter.setText(",")
            self.warning.show()
        
